import React from 'react';
import "./offer.css";
import busLogo from "../Images/busLogo.png"




const Offer = () => {
	return(
		<div>
		<div className="top-cont  ba">
      		  	<p className="heeader-title b white pt3">What We Offer?</p>
      		  	<h5 className=" white pt3">Integrated Impact Model</h5>
      		  	<h5 className=" white pt2 ">Ifria Offer Integrated Cold Chain Solutions to different Clients through two categories of services:</h5>
		</div>
		<img className="pt3 ba grow" src={busLogo} alt="logo" />
		</div>
		)
}




















export default Offer;
